import React from "react";

const ImageList = ({ images }) => {
  const imageItems = images.map((image) => {
    return (
      <li key={image.title}>
        <img src={image.url} />
      </li>
    );
  });

  return <ul className="img">{imageItems}</ul>;
};

export default ImageList;
